from flask import Flask
import webview
import json
import os

app = Flask("Raffle Machine")

@app.route("/")
def index():
    page = '''
    <!doctype html>
    <html lang="zh">
        <!--
            Author Bigsk(https://www.ianxia.com)
            Date: 2023-11-06
            MIT License
        -->
        <head>
            <!-- Required meta tags -->
            <meta charset="utf-8">
            <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
            <title>抽奖</title>
            <!-- Bootstrap -->
            <link href="static/bootstrap" rel="stylesheet">
            <script src="static/vue"></script>
            <style>
                .center-v{
                    position: absolute;
                    top: 50%;
                    left: 30%;
                    transform: translateY(-50%) translateX(-50%);
                }
            </style>
            <script>
                let roll_call = new Map([
    '''
    with open("data.json", "r", encoding="utf-8") as fb:
        try:
            data = json.loads(fb.read())
        except:
            data = {}
    
    for d in data.keys():
        page += '["{}", "{}"],'.format(d, data[d])

    page += '''
                ]);
            </script>
        </head>
        <body>
            <div class="container" id="app">
                <div class="row">
                    <div class="col-md-offset-11">
                        <br>
                        <h2>看看是谁这么幸运？</h2>
                        <div class="center-v">
                            <span v-html="result"></span>
                        </div>
                    </div>
                    <div class="col-md-offset-1">
                        <br>
                        <h4>&nbsp;&nbsp;中奖列表：</h4>
                        <strong>
                            <ol v-html="list">
                            </ol>
                        </strong>
                    </div>
                </div>
                <div class="fixed-bottom">
                    <div class="col-md-offset-8">
                        &nbsp;&nbsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;
                        <button class="btn btn-primary" @click="clickButton">{{button_text}}</button>
                        &nbsp;&nbsp;
                        <button class="btn btn-danger" onclick="location.reload();">刷新页面</button>
                        <br>
                        &nbsp;
                    </div>
                </div>
            </div>
            <script>
                new Vue({
                el: '#app',
                data: {
                    result: "<h1>等待抽奖</h1>",
                    status: false,
                    button_text: "开始抽奖",
                    selected: "",
                    priced: new Map(),
                    list: "<li>暂无中奖记录</li>",
                },
                methods: {
                    clickButton () {
                        if (this.status) {
                            clearInterval(this.timer);

                            if (roll_call.get(this.selected)) {
                                this.priced.set(this.selected, roll_call.get(this.selected));
                                this.list = "";
                                Array.from(this.priced.keys()).forEach(element => {
                                    this.list += "<li>" + this.priced.get(element) + "</li>";
                                });
                                console.log(this.priced);
                                roll_call.delete(this.selected);
                            }

                            this.button_text = "开始抽奖";
                            this.status = false;
                        } else {
                            this.button_text = "停止抽奖";
                            this.status = true;
                            this.roll_call_array = Array.from(roll_call.keys());
                            this.timer = setInterval(() => {
                                if (this.roll_call_array.length == 0) {
                                    this.result = "<h5>所有成员都已经中过奖了！</h5>";
                                } else {
                                    this.selected = this.roll_call_array[Math.floor(Math.random() * this.roll_call_array.length)];
                                    this.result = "<h1>" + roll_call.get(this.selected) + "</h1>";
                                }
                            }, 100);
                        }
                    }
                }
            })
            </script>
        </body>
    </html>
    '''
    return page

